import React from 'react';
import './Header.css';
import logo from '../assets/random-logo.png'; // Placeholder, replace with your own

import StatCard from './StatCard';
import logoSvg from '../assets/logo.svg';

function Header() {
  return (
    <header className="header dark-header">
      <div className="header-left">
        <StatCard value={<img src={logoSvg} alt="openbg logo" style={{width:'40px',height:'40px'}} />} label={<span className="header-brand">openbg</span>} />
      </div>
      <nav className="header-nav">
        <a href="#how" className="header-link dark-glass">How it works</a>
        <a href="#features" className="header-link dark-glass">Features</a>
        <a href="#download" className="header-link header-cta dark-glass">Start Removing</a>
      </nav>
    </header>
  );
}

export default Header;
